import Header from './Header'
import Footer from './Footer'


const layoutStyle = {
    margin: 20,
    padding: 20,
}

const headerStyle = {
    width: 50,
    border: '1px solid #DDD',
}

const footerStyle = {
    left: 0,
    bottom: 0,
    backgroundcolor: 'red',
    color: 'white',
    textalign: center,
}

export default function Layout(props) {
    return (
        <div style={layoutStyle}>
            <Header style={headerStyle}/>
            {props.children}
            <Footer style={footerStyle}/>
        </div>
    )
}
